arrowdown_encoded = b""
arrowleft_encoded = b""
arrowright_encoded = b""
arrowup_encoded = b""
minus_encoded = b""
plus_encoded = b""
save_encoded = b""
uploadimage_encoded = b""

from PIL import ImageTk, Image
import base64
from io import BytesIO

class ImageDecoder:
    
    @staticmethod
    def decode(image_object_b64):
        image_data = base64.b64decode(image_object_b64)
        image_stream = BytesIO(image_data)
        return Image.open(image_stream)
    
    @staticmethod
    def photo_from_image(image_object):
        width, height = image_object.size
        image_object.convert("RBG")
        return ImageTk.PhotoImage(image_object, size=(width, height))
    
    @staticmethod
    def bytes_to_photo(image_object_b64):
        decoded = ImageDecoder.decode(image_object_b64)
        return ImageDecoder.photo_from_image(decoded)


class Photos:
    arrow_down = ImageDecoder.bytes_to_photo(arrowdown_encoded)
    arrow_left = ImageDecoder.bytes_to_photo(arrowleft_encoded)
    arrow_right = ImageDecoder.bytes_to_photo(arrowright_encoded)
    arrow_up = ImageDecoder.bytes_to_photo(arrowup_encoded)
    minus = ImageDecoder.bytes_to_photo(minus_encoded)
    plus = ImageDecoder.bytes_to_photo(plus_encoded)
    save = ImageDecoder.bytes_to_photo(save_encoded)
    upload_image = ImageDecoder.bytes_to_photo(uploadimage_encoded)

